<p>『<b>チームE 5th Stage「SKEフェスティバル」</b>』（チームイーフィフスステージ えすけーいーふぇすてぃばる）は、<a href="." id="link_1"            >SKE48</a>チームE劇場公演の5th Stageである。AKB48チームサプライズの「バラの儀式」「重力シンパシー」をベースに独自に構成されたセットリスト。
</p><p>2016年9月9日から行われているSKE48チームEの5th公演である。
</p>
